import React from 'react'
import ReactDOM from 'react-dom'

class MyComponent extends React.Component {
    render(){
        <div>
            <h1>this.props</h1>
            <p>Outro Teste Aqui</p>
        </div>
    }
}

let data = {name:'Daniel', age:20}

ReactDOM.render(<MyComponent />, document.querySelector('#root'))
